import React from "react";
import './style.css';

interface SquareC {
  value: string;
}

interface ButtonClick {
  onClick 
}


function Square({ value }: SquareC) {
  function eventHandler() {
    console.log('clicked');
  }
  return <button className="square" onCLick={eventHandler}>{value}</button>;
}

export default function Board() {
  return (
    <>
      <div className="row">
        <Square value="X" />
        <Square value="X" />
        <Square value="O" />
      </div>
      <div className="row">
        <Square value="X" />
        <Square value="O" />
        <Square value="O" />
      </div>
      <div className="row">
        <Square value="X" />
        <Square value="X" />
        <Square value="O" />
      </div>
    </>
  );
}
